// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./EloquraPair.sol";

/**
 * @title EloquraFactory
 * @notice Factory contract for creating Eloqura trading pairs
 * @dev Creates and tracks all trading pairs in the DEX
 */
contract EloquraFactory {
    address public feeTo;
    address public feeToSetter;

    mapping(address => mapping(address => address)) public getPair;
    address[] public allPairs;

    // Fee tiers: 5 = 0.05%, 25 = 0.25%, 50 = 0.5%, 100 = 1%
    uint256[] public feeTiers = [5, 25, 50, 100];

    event PairCreated(address indexed token0, address indexed token1, address pair, uint256 pairIndex);
    event FeeToUpdated(address indexed oldFeeTo, address indexed newFeeTo);
    event FeeToSetterUpdated(address indexed oldSetter, address indexed newSetter);

    error IdenticalAddresses();
    error ZeroAddress();
    error PairExists();
    error Forbidden();

    constructor(address _feeToSetter) {
        feeToSetter = _feeToSetter;
    }

    function allPairsLength() external view returns (uint256) {
        return allPairs.length;
    }

    function createPair(address tokenA, address tokenB) external returns (address pair) {
        if (tokenA == tokenB) revert IdenticalAddresses();

        (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);

        if (token0 == address(0)) revert ZeroAddress();
        if (getPair[token0][token1] != address(0)) revert PairExists();

        bytes memory bytecode = type(EloquraPair).creationCode;
        bytes32 salt = keccak256(abi.encodePacked(token0, token1));

        assembly {
            pair := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }

        EloquraPair(pair).initialize(token0, token1);

        getPair[token0][token1] = pair;
        getPair[token1][token0] = pair;
        allPairs.push(pair);

        emit PairCreated(token0, token1, pair, allPairs.length);
    }

    function setFeeTo(address _feeTo) external {
        if (msg.sender != feeToSetter) revert Forbidden();
        address oldFeeTo = feeTo;
        feeTo = _feeTo;
        emit FeeToUpdated(oldFeeTo, _feeTo);
    }

    function setFeeToSetter(address _feeToSetter) external {
        if (msg.sender != feeToSetter) revert Forbidden();
        address oldSetter = feeToSetter;
        feeToSetter = _feeToSetter;
        emit FeeToSetterUpdated(oldSetter, _feeToSetter);
    }

    function getFeeTiers() external view returns (uint256[] memory) {
        return feeTiers;
    }

    /// @notice Compute pair address without calling the factory
    function pairFor(address tokenA, address tokenB) external view returns (address) {
        return getPair[tokenA][tokenB];
    }
}

contracts/EloquraLimitOrders.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./EloquraRouter.sol";

/**
 * @title EloquraLimitOrders
 * @notice Limit order functionality for the Eloqura DEX
 * @dev Allows users to place orders that execute when price conditions are met
 */
contract EloquraLimitOrders is ReentrancyGuard, Ownable {
    using SafeERC20 for IERC20;

    EloquraRouter public immutable router;

    struct Order {
        address owner;
        address tokenIn;
        address tokenOut;
        uint256 amountIn;
        uint256 minAmountOut;      // Minimum output (acts as limit price)
        uint256 triggerPrice;       // Price at which order becomes executable (scaled by 1e18)
        uint256 expiry;
        bool executed;
        bool cancelled;
    }

    uint256 public nextOrderId;
    mapping(uint256 => Order) public orders;
    mapping(address => uint256[]) public userOrders;

    uint256 public executorFeeBps = 10; // 0.1% fee for executors

    event OrderPlaced(
        uint256 indexed orderId,
        address indexed owner,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        uint256 triggerPrice,
        uint256 expiry
    );

    event OrderExecuted(
        uint256 indexed orderId,
        address indexed executor,
        uint256 amountIn,
        uint256 amountOut,
        uint256 executorFee
    );

    event OrderCancelled(uint256 indexed orderId);

    error OrderNotFound();
    error OrderAlreadyExecuted();
    error OrderAlreadyCancelled();
    error OrderExpired();
    error OrderNotExpired();
    error NotOrderOwner();
    error PriceConditionNotMet();
    error InvalidAmount();
    error InvalidExpiry();

    constructor(address _router) Ownable(msg.sender) {
        router = EloquraRouter(payable(_router));
    }

    /**
     * @notice Place a limit order
     * @param tokenIn Token to sell
     * @param tokenOut Token to buy
     * @param amountIn Amount of tokenIn to sell
     * @param minAmountOut Minimum amount of tokenOut to receive
     * @param triggerPrice Price (tokenOut/tokenIn * 1e18) at which order can execute
     * @param expiry Timestamp when order expires
     */
    function placeOrder(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        uint256 triggerPrice,
        uint256 expiry
    ) external nonReentrant returns (uint256 orderId) {
        if (amountIn == 0 || minAmountOut == 0) revert InvalidAmount();
        if (expiry <= block.timestamp) revert InvalidExpiry();

        // Transfer tokens to this contract
        IERC20(tokenIn).safeTransferFrom(msg.sender, address(this), amountIn);

        orderId = nextOrderId++;

        orders[orderId] = Order({
            owner: msg.sender,
            tokenIn: tokenIn,
            tokenOut: tokenOut,
            amountIn: amountIn,
            minAmountOut: minAmountOut,
            triggerPrice: triggerPrice,
            expiry: expiry,
            executed: false,
            cancelled: false
        });

        userOrders[msg.sender].push(orderId);

        emit OrderPlaced(orderId, msg.sender, tokenIn, tokenOut, amountIn, minAmountOut, triggerPrice, expiry);
    }

    /**
     * @notice Execute a limit order (can be called by anyone when conditions are met)
     * @param orderId The order to execute
     */
    function executeOrder(uint256 orderId) external nonReentrant {
        Order storage order = orders[orderId];

        if (order.owner == address(0)) revert OrderNotFound();
        if (order.executed) revert OrderAlreadyExecuted();
        if (order.cancelled) revert OrderAlreadyCancelled();
        if (block.timestamp > order.expiry) revert OrderExpired();

        // Check if price condition is met
        address[] memory path = new address[](2);
        path[0] = order.tokenIn;
        path[1] = order.tokenOut;

        uint256[] memory amounts = router.getAmountsOut(order.amountIn, path);
        uint256 expectedOut = amounts[1];

        // Calculate current price
        uint256 currentPrice = (expectedOut * 1e18) / order.amountIn;

        // For a buy limit order (buying tokenOut), we want price <= triggerPrice
        // For a sell limit order, we want price >= triggerPrice
        // Since this is a swap from tokenIn to tokenOut, higher price is better for user
        if (currentPrice < order.triggerPrice) revert PriceConditionNotMet();

        // Check minimum output
        if (expectedOut < order.minAmountOut) revert PriceConditionNotMet();

        // Mark as executed
        order.executed = true;

        // Calculate executor fee
        uint256 executorFee = (order.amountIn * executorFeeBps) / 10000;
        uint256 swapAmount = order.amountIn - executorFee;

        // Approve router
        IERC20(order.tokenIn).approve(address(router), swapAmount);

        // Execute swap
        uint256[] memory swapAmounts = router.swapExactTokensForTokens(
            swapAmount,
            order.minAmountOut,
            path,
            order.owner,
            block.timestamp
        );

        // Pay executor fee
        if (executorFee > 0) {
            IERC20(order.tokenIn).safeTransfer(msg.sender, executorFee);
        }

        emit OrderExecuted(orderId, msg.sender, swapAmount, swapAmounts[1], executorFee);
    }

    /**
     * @notice Cancel an order and refund tokens
     * @param orderId The order to cancel
     */
    function cancelOrder(uint256 orderId) external nonReentrant {
        Order storage order = orders[orderId];

        if (order.owner == address(0)) revert OrderNotFound();
        if (order.executed) revert OrderAlreadyExecuted();
        if (order.cancelled) revert OrderAlreadyCancelled();
        if (msg.sender != order.owner) revert NotOrderOwner();

        order.cancelled = true;

        // Refund tokens
        IERC20(order.tokenIn).safeTransfer(order.owner, order.amountIn);

        emit OrderCancelled(orderId);
    }

    /**
     * @notice Claim expired order tokens
     * @param orderId The expired order
     */
    function claimExpired(uint256 orderId) external nonReentrant {
        Order storage order = orders[orderId];

        if (order.owner == address(0)) revert OrderNotFound();
        if (order.executed) revert OrderAlreadyExecuted();
        if (order.cancelled) revert OrderAlreadyCancelled();
        if (block.timestamp <= order.expiry) revert OrderNotExpired();
        if (msg.sender != order.owner) revert NotOrderOwner();

        order.cancelled = true;

        // Refund tokens
        IERC20(order.tokenIn).safeTransfer(order.owner, order.amountIn);

        emit OrderCancelled(orderId);
    }

    /**
     * @notice Get order details
     */
    function getOrder(uint256 orderId) external view returns (
        address owner,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        uint256 triggerPrice,
        uint256 expiry,
        bool executed,
        bool cancelled
    ) {
        Order storage order = orders[orderId];
        return (
            order.owner,
            order.tokenIn,
            order.tokenOut,
            order.amountIn,
            order.minAmountOut,
            order.triggerPrice,
            order.expiry,
            order.executed,
            order.cancelled
        );
    }

    /**
     * @notice Get all orders for a user
     */
    function getUserOrders(address user) external view returns (uint256[] memory) {
        return userOrders[user];
    }

    /**
     * @notice Check if an order is executable
     */
    function isExecutable(uint256 orderId) external view returns (bool executable, string memory reason) {
        Order storage order = orders[orderId];

        if (order.owner == address(0)) return (false, "Order not found");
        if (order.executed) return (false, "Already executed");
        if (order.cancelled) return (false, "Cancelled");
        if (block.timestamp > order.expiry) return (false, "Expired");

        // Check price
        address[] memory path = new address[](2);
        path[0] = order.tokenIn;
        path[1] = order.tokenOut;

        try router.getAmountsOut(order.amountIn, path) returns (uint256[] memory amounts) {
            uint256 expectedOut = amounts[1];
            uint256 currentPrice = (expectedOut * 1e18) / order.amountIn;

            if (currentPrice < order.triggerPrice) {
                return (false, "Price condition not met");
            }
            if (expectedOut < order.minAmountOut) {
                return (false, "Output below minimum");
            }

            return (true, "Executable");
        } catch {
            return (false, "Quote failed");
        }
    }

    /**
     * @notice Update executor fee (owner only)
     */
    function setExecutorFeeBps(uint256 _feeBps) external onlyOwner {
        require(_feeBps <= 100, "Fee too high"); // Max 1%
        executorFeeBps = _feeBps;
    }
}

contracts/EloquraPair.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";

/**
 * @title EloquraPair
 * @notice AMM liquidity pool for a token pair
 * @dev Implements constant product market maker (x * y = k)
 */
contract EloquraPair is ERC20, ReentrancyGuard {
    using Math for uint256;

    uint256 public constant MINIMUM_LIQUIDITY = 1000;
    uint256 public constant FEE_DENOMINATOR = 10000;
    uint256 public swapFeeBps = 30; // 0.3% default fee

    address public factory;
    address public token0;
    address public token1;

    uint112 private reserve0;
    uint112 private reserve1;
    uint32 private blockTimestampLast;

    uint256 public price0CumulativeLast;
    uint256 public price1CumulativeLast;
    uint256 public kLast; // reserve0 * reserve1, as of immediately after the most recent liquidity event

    // Position tracking for concentrated liquidity-like features
    struct Position {
        uint128 liquidity;
        uint256 feeGrowthInside0LastX128;
        uint256 feeGrowthInside1LastX128;
        uint128 tokensOwed0;
        uint128 tokensOwed1;
    }

    mapping(address => Position) public positions;
    uint256 public feeGrowthGlobal0X128;
    uint256 public feeGrowthGlobal1X128;

    event Mint(address indexed sender, uint256 amount0, uint256 amount1);
    event Burn(address indexed sender, uint256 amount0, uint256 amount1, address indexed to);
    event Swap(
        address indexed sender,
        uint256 amount0In,
        uint256 amount1In,
        uint256 amount0Out,
        uint256 amount1Out,
        address indexed to
    );
    event Sync(uint112 reserve0, uint112 reserve1);
    event FeesCollected(address indexed owner, uint256 amount0, uint256 amount1);

    error Locked();
    error Overflow();
    error InsufficientLiquidityMinted();
    error InsufficientLiquidityBurned();
    error InsufficientOutputAmount();
    error InsufficientInputAmount();
    error InsufficientLiquidity();
    error InvalidTo();
    error InvalidK();
    error Forbidden();

    constructor() ERC20("Eloqura LP Token", "ELQ-LP") {
        factory = msg.sender;
    }

    function initialize(address _token0, address _token1) external {
        if (msg.sender != factory) revert Forbidden();
        token0 = _token0;
        token1 = _token1;
    }

    function getReserves() public view returns (uint112 _reserve0, uint112 _reserve1, uint32 _blockTimestampLast) {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
        _blockTimestampLast = blockTimestampLast;
    }

    function _update(uint256 balance0, uint256 balance1, uint112 _reserve0, uint112 _reserve1) private {
        if (balance0 > type(uint112).max || balance1 > type(uint112).max) revert Overflow();

        uint32 blockTimestamp = uint32(block.timestamp % 2**32);
        uint32 timeElapsed;
        unchecked {
            timeElapsed = blockTimestamp - blockTimestampLast;
        }

        if (timeElapsed > 0 && _reserve0 != 0 && _reserve1 != 0) {
            unchecked {
                price0CumulativeLast += uint256(_reserve1) * timeElapsed / _reserve0;
                price1CumulativeLast += uint256(_reserve0) * timeElapsed / _reserve1;
            }
        }

        reserve0 = uint112(balance0);
        reserve1 = uint112(balance1);
        blockTimestampLast = blockTimestamp;

        emit Sync(reserve0, reserve1);
    }

    function _mintFee(uint112 _reserve0, uint112 _reserve1) private returns (bool feeOn) {
        address feeTo = IEloquraFactory(factory).feeTo();
        feeOn = feeTo != address(0);
        uint256 _kLast = kLast;

        if (feeOn) {
            if (_kLast != 0) {
                uint256 rootK = Math.sqrt(uint256(_reserve0) * _reserve1);
                uint256 rootKLast = Math.sqrt(_kLast);
                if (rootK > rootKLast) {
                    uint256 numerator = totalSupply() * (rootK - rootKLast);
                    uint256 denominator = rootK * 5 + rootKLast;
                    uint256 liquidity = numerator / denominator;
                    if (liquidity > 0) _mint(feeTo, liquidity);
                }
            }
        } else if (_kLast != 0) {
            kLast = 0;
        }
    }

    function mint(address to) external nonReentrant returns (uint256 liquidity) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();
        uint256 balance0 = IERC20(token0).balanceOf(address(this));
        uint256 balance1 = IERC20(token1).balanceOf(address(this));
        uint256 amount0 = balance0 - _reserve0;
        uint256 amount1 = balance1 - _reserve1;

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint256 _totalSupply = totalSupply();

        if (_totalSupply == 0) {
            liquidity = Math.sqrt(amount0 * amount1) - MINIMUM_LIQUIDITY;
            _mint(address(0xdead), MINIMUM_LIQUIDITY); // permanently lock first MINIMUM_LIQUIDITY
        } else {
            liquidity = Math.min(
                (amount0 * _totalSupply) / _reserve0,
                (amount1 * _totalSupply) / _reserve1
            );
        }

        if (liquidity == 0) revert InsufficientLiquidityMinted();

        _mint(to, liquidity);

        // Track position
        positions[to].liquidity += uint128(liquidity);

        _update(balance0, balance1, _reserve0, _reserve1);

        if (feeOn) kLast = uint256(reserve0) * reserve1;

        emit Mint(msg.sender, amount0, amount1);
    }

    function burn(address to) external nonReentrant returns (uint256 amount0, uint256 amount1) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();
        address _token0 = token0;
        address _token1 = token1;
        uint256 balance0 = IERC20(_token0).balanceOf(address(this));
        uint256 balance1 = IERC20(_token1).balanceOf(address(this));
        uint256 liquidity = balanceOf(address(this));

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint256 _totalSupply = totalSupply();

        amount0 = (liquidity * balance0) / _totalSupply;
        amount1 = (liquidity * balance1) / _totalSupply;

        if (amount0 == 0 || amount1 == 0) revert InsufficientLiquidityBurned();

        _burn(address(this), liquidity);

        _safeTransfer(_token0, to, amount0);
        _safeTransfer(_token1, to, amount1);

        balance0 = IERC20(_token0).balanceOf(address(this));
        balance1 = IERC20(_token1).balanceOf(address(this));

        _update(balance0, balance1, _reserve0, _reserve1);

        if (feeOn) kLast = uint256(reserve0) * reserve1;

        emit Burn(msg.sender, amount0, amount1, to);
    }

    function swap(uint256 amount0Out, uint256 amount1Out, address to, bytes calldata data) external nonReentrant {
        if (amount0Out == 0 && amount1Out == 0) revert InsufficientOutputAmount();

        (uint112 _reserve0, uint112 _reserve1,) = getReserves();

        if (amount0Out >= _reserve0 || amount1Out >= _reserve1) revert InsufficientLiquidity();

        uint256 balance0;
        uint256 balance1;
        {
            address _token0 = token0;
            address _token1 = token1;

            if (to == _token0 || to == _token1) revert InvalidTo();

            if (amount0Out > 0) _safeTransfer(_token0, to, amount0Out);
            if (amount1Out > 0) _safeTransfer(_token1, to, amount1Out);

            if (data.length > 0) {
                IEloquraCallee(to).eloquraCall(msg.sender, amount0Out, amount1Out, data);
            }

            balance0 = IERC20(_token0).balanceOf(address(this));
            balance1 = IERC20(_token1).balanceOf(address(this));
        }

        uint256 amount0In = balance0 > _reserve0 - amount0Out ? balance0 - (_reserve0 - amount0Out) : 0;
        uint256 amount1In = balance1 > _reserve1 - amount1Out ? balance1 - (_reserve1 - amount1Out) : 0;

        if (amount0In == 0 && amount1In == 0) revert InsufficientInputAmount();

        {
            // Apply fee (0.3% = 30 bps)
            uint256 balance0Adjusted = balance0 * FEE_DENOMINATOR - amount0In * swapFeeBps;
            uint256 balance1Adjusted = balance1 * FEE_DENOMINATOR - amount1In * swapFeeBps;

            if (balance0Adjusted * balance1Adjusted < uint256(_reserve0) * _reserve1 * (FEE_DENOMINATOR ** 2)) {
                revert InvalidK();
            }

            // Update fee growth for LPs
            if (amount0In > 0) {
                uint256 fee0 = (amount0In * swapFeeBps) / FEE_DENOMINATOR;
                feeGrowthGlobal0X128 += (fee0 << 128) / totalSupply();
            }
            if (amount1In > 0) {
                uint256 fee1 = (amount1In * swapFeeBps) / FEE_DENOMINATOR;
                feeGrowthGlobal1X128 += (fee1 << 128) / totalSupply();
            }
        }

        _update(balance0, balance1, _reserve0, _reserve1);

        emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);
    }

    /// @notice Force balances to match reserves
    function skim(address to) external nonReentrant {
        address _token0 = token0;
        address _token1 = token1;
        _safeTransfer(_token0, to, IERC20(_token0).balanceOf(address(this)) - reserve0);
        _safeTransfer(_token1, to, IERC20(_token1).balanceOf(address(this)) - reserve1);
    }

    /// @notice Force reserves to match balances
    function sync() external nonReentrant {
        _update(
            IERC20(token0).balanceOf(address(this)),
            IERC20(token1).balanceOf(address(this)),
            reserve0,
            reserve1
        );
    }

    /// @notice Collect accumulated fees for a liquidity provider
    function collectFees(address owner) external returns (uint256 amount0, uint256 amount1) {
        Position storage position = positions[owner];

        amount0 = uint256(position.tokensOwed0);
        amount1 = uint256(position.tokensOwed1);

        if (amount0 > 0) {
            position.tokensOwed0 = 0;
            _safeTransfer(token0, owner, amount0);
        }
        if (amount1 > 0) {
            position.tokensOwed1 = 0;
            _safeTransfer(token1, owner, amount1);
        }

        emit FeesCollected(owner, amount0, amount1);
    }

    /// @notice Get position info for a liquidity provider
    function getPosition(address owner) external view returns (
        uint128 liquidity,
        uint128 tokensOwed0,
        uint128 tokensOwed1
    ) {
        Position storage position = positions[owner];
        return (position.liquidity, position.tokensOwed0, position.tokensOwed1);
    }

    /// @notice Get current price (token1 per token0)
    function getPrice() external view returns (uint256) {
        if (reserve0 == 0) return 0;
        return (uint256(reserve1) * 1e18) / reserve0;
    }

    /// @notice Calculate output amount for a given input
    function getAmountOut(uint256 amountIn, bool zeroForOne) external view returns (uint256 amountOut) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();

        uint256 reserveIn = zeroForOne ? _reserve0 : _reserve1;
        uint256 reserveOut = zeroForOne ? _reserve1 : _reserve0;

        uint256 amountInWithFee = amountIn * (FEE_DENOMINATOR - swapFeeBps);
        uint256 numerator = amountInWithFee * reserveOut;
        uint256 denominator = reserveIn * FEE_DENOMINATOR + amountInWithFee;

        amountOut = numerator / denominator;
    }

    /// @notice Calculate input amount for a given output
    function getAmountIn(uint256 amountOut, bool zeroForOne) external view returns (uint256 amountIn) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();

        uint256 reserveIn = zeroForOne ? _reserve0 : _reserve1;
        uint256 reserveOut = zeroForOne ? _reserve1 : _reserve0;

        uint256 numerator = reserveIn * amountOut * FEE_DENOMINATOR;
        uint256 denominator = (reserveOut - amountOut) * (FEE_DENOMINATOR - swapFeeBps);

        amountIn = (numerator / denominator) + 1;
    }

    function _safeTransfer(address token, address to, uint256 value) private {
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(IERC20.transfer.selector, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), "TRANSFER_FAILED");
    }
}

interface IEloquraFactory {
    function feeTo() external view returns (address);
}

interface IEloquraCallee {
    function eloquraCall(address sender, uint256 amount0, uint256 amount1, bytes calldata data) external;
}

